const handleSubmit = fields => {
    const { firstName, lastName, email, subject, password } = fields;

    Alert.alert(
      "Your info",
      `First Name: ${firstName.value}\n Last Name: ${lastName.value}\n Email: ${
        email.value
      }\n Subject: ${subject.value} \n Password: ${password.value}`
    );
  };
